import React from 'react';
import PropTypes from 'prop-types';
import 'antd/dist/antd.css'

const NodeBird = ({Com}) => {
    return(
        <>
        <div>공통메뉴</div>
        <Com />
        </>
    )
}
NodeBird.propTypes = {
    Com: PropTypes.element.isRequired,
}

export default NodeBird
